-- UPDATE PARA ATUALIZAR OS PONTOS PARA CAOS

update pontos 
	set id_padrao = 31
where codigo_abrigo in (
	select simak from publicidadeveiculacao 
	where simak not in (
		select codigo_abrigo from pontos
		inner join pontospadrao on pontos.id_padrao = pontospadrao.id_padrao
		inner join pontostipo on pontospadrao.id_tipo = pontostipo.id_tipo
		where pontostipo.id_tipo = 4
	)
	and nome_imagem != 'SEM CARTAZ'
);

----------------------------------------------------------------------------

-- RETIRAR LANÇAMENTOS QUE NAO SEJAM CAOS!!!

delete from publicidadeveiculacao 
where simak not in (
	select codigo_abrigo from pontos
	inner join pontospadrao on pontos.id_padrao = pontospadrao.id_padrao
	inner join pontostipo on pontospadrao.id_tipo = pontostipo.id_tipo
	where pontostipo.id_tipo = 4
);

